import Card from "./Components/Card/Card";
import Header from "./Components/Header/Header";
import Recommendation from "./Components/Recommendation/Recommendation";

function App() {
  return (
    <div className="App">
      <Header />
      <h1>Hello World</h1>
      <Card />
      <Recommendation />
    </div>
  );
}

export default App;
